import React, { useState, useEffect } from "react";

import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";

import { useTheme } from "@mui/material/styles";

import { useParams } from "react-router-dom";

import { getDetailClass } from "../../api/soup";

import Footer from "../Footer/Footer";
import { ListMenuClass } from "../ListMenuKelasPage/ListMenuKelasPage";

const DetailKelasPage = () => {
  const theme = useTheme();
  const primaryColor = theme.palette.primary.main;
  const gray1 = theme.palette.gray1.main;
  const gray3 = theme.palette.gray3.main;
  const poppins = theme.typography.poppins.fontFamily;

  const buttonStyle = {
    width: "234px",
    textTransform: "none",
    color: primaryColor,
    borderRadius: "8px",
  };

  const { courseId } = useParams();

  const [data, setData] = useState(null);
  const [schedule, setSchedule] = useState("");

  useEffect(() => {
    setData(null);
    getDetailClass(courseId)
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [courseId]);

  const handleChange = (event) => {
    setSchedule(event.target.value);
  };

  if (!data) return null;

  return (
    <Stack spacing="178px">
      <div>
        <Stack
          spacing={5}
          sx={{
            width: "1140px",
            margin: "0 auto",
            marginTop: "40px",
            marginBottom: "160px",
            textAlign: "left",
          }}
        >
          <Stack direction="row" spacing={5}>
            <img
              src={`data:image;base64,${data.course.image_content}`}
              width="400"
              height="267"
            />
            <Stack spacing="60px">
              <Stack spacing={4}>
                <Stack spacing={1}>
                  <Typography
                    paragraph={true}
                    sx={{ margin: "0", color: gray3 }}
                  >
                    {data.course.category_name}
                  </Typography>
                  <Typography
                    variant="h5"
                    component="h1"
                    sx={{ fontWeight: "600", color: gray1 }}
                  >
                    {data.course.name}
                  </Typography>
                  <Typography
                    variant="h5"
                    component="h2"
                    color="primary"
                    sx={{ fontWeight: "600" }}
                  >
                    IDR {data.course.price.toLocaleString("id")}
                  </Typography>
                </Stack>

                <FormControl sx={{ width: "300px", height: "40px" }}>
                  <InputLabel id="select-schedule-label">
                    Select Schedule
                  </InputLabel>
                  <Select
                    labelId="select-schedule-label"
                    label="Select Schedule"
                    value={schedule}
                    onChange={handleChange}
                  >
                    <MenuItem value="25-07-2022">Monday, 25 July 2022</MenuItem>
                    <MenuItem value="26-07-2022">
                      Tuesday, 26 July 2022
                    </MenuItem>
                    <MenuItem value="27-07-2022">
                      Wednesday, 27 July 2022
                    </MenuItem>
                    <MenuItem value="28-07-2022">
                      Thursday, 28 July 2022
                    </MenuItem>
                    <MenuItem value="29-07-2022">Friday, 29 July 2022</MenuItem>
                    <MenuItem value="30-07-2022">
                      Saturday, 30 July 2022
                    </MenuItem>
                  </Select>
                </FormControl>
              </Stack>

              <Stack direction="row" spacing={2}>
                <Button variant="outlined" color="primary" sx={buttonStyle}>
                  Add to Cart
                </Button>
                <Button variant="contained" color="secondary" sx={buttonStyle}>
                  Buy Now
                </Button>
              </Stack>
            </Stack>
          </Stack>

          <Stack spacing={2}>
            <Typography
              variant="h5"
              component="h3"
              sx={{ color: gray1, fontWeight: "600" }}
            >
              Description
            </Typography>

            <Stack spacing={3}>
              <Typography
                paragraph={true}
                sx={{ color: gray1, marginBottom: "0" }}
              >
                {data.course.description}
              </Typography>

              <Typography
                paragraph={true}
                sx={{ color: gray1, fontFamily: poppins }}
              >
                {data.course.description}
              </Typography>
            </Stack>
          </Stack>
        </Stack>

        <ListMenuClass courses={data.other_courses} />
      </div>

      {/* <Footer /> */}
    </Stack>
  );
};

export default DetailKelasPage;
